$(".edit_album").validate({
    //error place
    errorPlacement: function (error, element) {
      error.insertBefore(element);
    },
    rules: {
    "album[title]":{
      required: true,
    }
    },
    // error messages
    messages: {
      title:{
        required: "You must enter new title"
      }
    }

  });
